A '''Stark guard''' is an unnamed minor character in the [[Season 2|second season]]. He is played by guest star [[David Sheehan]] and only appears in &quot;[[A Man Without Honor]].&quot;

sections.Biography:
===[[Season 2]]===
He is guarding the recaptured [[Jaime Lannister]] when he is dismissed by [[Catelyn Stark]].&lt;ref&gt;&quot;[[A Man Without Honor]]&quot;&lt;/ref&gt;

He is assigned to guard Catelyn after she betrays Robb by releasing Jaime.&lt;ref&gt;&quot;[[The Prince of Winterfell]]&quot;&lt;/ref&gt;
